import React, { Component } from 'react';
import {Col} from 'react-bootstrap';
import Page from '../Page';
import Data from '../Data';
import Product from '../HomePageComponent/Product';
import NewProduct from '../HomePageComponent/NewProduct';
import MyCarousel from '../HomePageComponent/Carousel';
import BestSeller from '../HomePageComponent/BestSeller';
import Guitarist from '../HomePageComponent/Guitarist';
class HomePage extends Component {


  constructor(props) {
    super(props);
    this.state = {
        content: []
    }
  }
  buildContent() {
    let _content = [];

    let data = Data.data;
    for(var i in data) {
        _content.push(
            <Col key={i} xs={6} md={4}>
                <Product data={data[i]}></Product>
            </Col>
        );
    }

    let _productContent = [];

    _productContent.push(<MyCarousel key="myCarousel"></MyCarousel>)
    _productContent.push(<NewProduct key="myCarousel"></NewProduct>)
    _productContent.push(<BestSeller></BestSeller>)
    _productContent.push(<Guitarist></Guitarist>)
    // _productContent.push(<Nav key="nav"></Nav>);
    // _productContent.push(<Grid key="content"><Row key={i}>{_content}</Row></Grid>);
    return _productContent;
  }

  componentDidMount() {
      this.setState({
          content: this.buildContent()
      });
  }
  
  render() {
      return (
        <div>
          <Page content={this.state.content}></Page>
        </div>
      );
    }
  }

export default HomePage;
